body:
part conditioner: PowerConditioner {
port :>> electricalPowerIn;
port :>> electricalPowerOut;
}
connect powerInPort to conditioner::electricalPowerIn;
connect conditioner::electricalPowerOut to powerOutPort;

part def PowerConditioner {
port electricalPowerIn: PowerInTerminal;
port electricalPowerOut: PowerOutTerminal;
}
